settings.custom_css:
selector {
    max-height: 100vh;
    overflow-y: scroll;
}
/* width */
selecor::-webkit-scrollbar {
  width: 5px;
}

/* Track */
selecor::-webkit-scrollbar-track {
  background: #EEE; 
}

/* Handle */
selecor::-webkit-scrollbar-thumb {
  background: #16CC8E; 
}

/* Handle on hover */
selecor::-webkit-scrollbar-thumb:hover {
  background: #555; 
}
